    'Expand your skills of usage Laptops to improve your knowledge in area of education' => 'Ausbreite ihrige Fertigkeiten der Ausnutzung Notizbuch, auf daß zu bessern ihriges Wissen in Gebiet der Ausbildung',
    'Laptop computers are becoming increasingly prevalent in education. Great part of skills required to maintain the device became readily to know all the special. While laptops may present opportunities for distraction, utilizing portable computers in classrooms can yield several significant benefits.' => 'Portabel Computer hinstellen immer mehr ausgebreitete in Ausbildung. Großer Anteil der Fertigkeiten, die für Unterhaltung der Einrichtung wurde, all besonderer erforderlich leicht zu kennen ist. Während Notizbuch können vorstellen sich Möglichkeiten für Ablenkung der Aufmerksamkeit, ausnutzt portabel Computer in Klassen kann geben respektierliche Bevorzugungen.',
    'A lot of fun for Students & Teachers' => 'Reich fun für Fernstudenten & unterrichten',
    'Laptops can provide a high level of interactivity between students, teachers and subject matter. For instance, a teacher could challenge students to find the answer to a question about history or some other subject using their laptops online. This would force students to conduct quick research and use creativity to find the answer than paging through a dense textbook.' => 'Notizbuch können versorgen hoches Niveau Online zwischen Fernstudenten, unterrichten und Gegenstand. Z.B., Lehrer kann absprechen Fernstudenten, auf daß zu finden Antwort auf Frage Geschichten oder irgendeines anderes Objekt, ausnutzt ihriger Notizbuch in Internet.
    Dieser bemüßigt Fernstudenten zu durchführen schneller Durchforschungen und zu ausnutzen bildender, auf daß zu finden Antwort, was zu blättern in dichter Lehrbuch.',
    'Another potential benefit of using laptops in classrooms is that using computers is more fun for students than simply sitting at a desk and listening to a lecture with a pad of paper and a pen. Students that have fun in the classroom are more likely to come to school.' => 'Noch eins potentialer Vorteil ab Ausnutzung Notizbuch in Klassen, daß Ausnutzung der Computer sein aufgemundert, als für Fernstudenten einfach herumsitzt hinter Tisch und zu zuhören Vorlesung mit Block und Bügel. Fernstudenten, die Vergnügen in Klasse haben, ziemlich all, herkommen in Schule.',
    'Stay organized and remember all work' => 'Plane und behalt all Arbeiten',
    'When you have six or more classes, it is easy to misplace a worksheet or forget about an assignment. If teachers distribute assignments digitally, students can easily review their work all in one place. Digital copies of work also help students by making it easy to edit or change work.' => 'Falls bei euch ist sechs oder mehr der Klassen, leicht verlieren Blatt oder zu vergessen über Aussetzung. Falls Lehrer aufschlüsselte in Zifferäußere, Fernstudenten können leicht blättern ihriges Arbeiten all in eins Ort. Ziffernkopien des Arbeitens gleichfalls zu aufhelfen Fernstudenten, erledigt ihn es leicht zu cutten oder zu verraten Arbeiten.',
    'All data in one place' => 'All Angaben in eins Ort',
    'Control your schedule via Macbook\'s Apps like Clocks or Calendar. Its really easy to make important marks and control your time. Windows provide either those Apps whats make your life absolutely complete' => 'Kontrolliere ihrigen graphischen Plan durch Macbook der Anbiegungen, als Uhren oder Kalender. Ihn es ist blitzeinfach, beachtenswerte Zeichen und zu kontrollieren ihrige Zeit zu erledigen. Fenster oder zu versorgen diese Anbiegungen Daß zu erledigen euer Leben absolut beleibtes',
    'Collect / Compare all projects' => 'Ablies / Vergleich all Projekte',
    'It\'s really easy to compare your projects with your mates or send your task to your teacher for review. Every project can be saved in one place for an reason to collect all data and rewrite them into another one.' => 'Dieser es gültig leicht Vergleich bedient sich ihrige Projekte mit Genossen oder zu abfertigen euere Aufgabe zu ihrigem Lehrer auf Versuch. Jedes Projekt kann sein behalten in eins Ort in Strömung Anlaß, auf daß zu ablesen all Angaben und Rewrite sie in anderer.',
    'Edit / Change everywhere' => 'Korrigiere / Tausche irgendwo',
    'If someone wants to make any significant improvements into your work you can make it just in your own laptop without correcting the whole assignment paper.' => 'Falls jemand beliebt, auf daß zu machen irgendeine respektierliche Aufbesserungen in euerem Arbeiten ihr können erledigen dieser allein in euer eigener Notizbuch ohne korrigiert all Papier Zuordnung.',
    'Useful device for teachers as well' => 'Gebraucht Gegenstand für Lehrer desgleichen',
    'Usability with collection and sorting' => 'Leichtheit mit Sammeln und Sonderung',
    'Having students turn work in via email or another digital system is easier than collecting and sorting through stacks of physical paper.' => 'Vorhandensein Fernstudenten zu wenden sich zu arbeiten in elektronischer Post oder anderer Ziffergebäude sein einfach, als Sammeln und Sonderung Stacks körperliches Arbeiten.',
    'Work remotely, increasing productivity' => 'Arbeite entfernt, Aufsteigen der Arbeitsleistung',
    'Whats more, digital assignments allow students that have to miss school to turn in work remotely, reducing the inequity of allowing students extensions on assignments for missing class.' => 'Daß größer, Ziffernaufgaben erlauben Fernstudenten, die versäumen Schule müssen, auf daß zu transformieren in Arbeiten entfernt, abmindert Erbitterung erlaubt Fernstudenten der Ausbreitung auf Abschläge für ist abgängiger Klasse.',
    'The best result for the same time' => 'Besseres Ergebnis vor eins und gleichfalls Zeit',
    'Additionally, typewritten assignments are much easier to read than those written by hand. Thats why, this will decrease spending time of students and teachers either' => 'Außerdem, maschinegeschriebene Aufgaben es ist viel leicht, zu hinweglesen, als das, das ab Arm aufgeschrieben ist. Da warum, dieser abmindert zu durchführen Zeit der Fernstudenten und unterrichten oder',
