    'Usage of phones through adults nowadays' => 'Ausnutzung der Fernsprecher durch Erwachsene gegenwärtig',
    'Today, over 85% of people use mobile phones to stay connected (to get homework tasks, getting data, compare answers etc.) organized (clocks, calculator) and entertained. And, now that mobile phones are capable of doing much more than simply calling and texting, they have started to replace other devices like cameras and desktop computers.' => 'Heute, mehr 85 Menschen ausnutzen mobile Fernsprecher, auf daß zu bleiben an Band (für Empfang der Hausaufgaben, Empfang der Angaben, Vergleich bedient sich Antworten usw.) organisierte (Uhren, Kalkulator) und amüsoren.
