    'Taxes in Poland are levied by both the federal and regional governments. Tax revenue in Poland is 31.7% of the country\'s GDP in 2009. The most important revenue sources include the income tax, Social Security, corporate tax and the value added tax, which are all applied on the national level. Income earned is generally subject to a progressive income tax, which apply to all who are in the workforce. For the year 2014, two different tax rates on income apply.' => 'Steuern in Polen erheben an Bund und reginäre Machtorgane.
    Steuereinnahmen in Polen abfasst 31,7 Gebiet Länder VVP in dem 2009 Jahr höchst beachtenswerte Quellen des Einkommens schalten Einkommen Steuer, Sozialfürsorge, korporative Steuer und Steuer auf subsumierten Betrag, das all anpassen sich an nationalem Niveau. Einkommen, als Regel, unterliegen fortschrittliche Einkommen Steuer, das anpassen sich zu all, wer in Arbeitskraft ist. Für das 2014 Jahr, zwei diverser Steuernsatz auf Einkommen anpaßt sich.',
    'The Code is designed as a complete national system for federal, regional and local taxes but excludes customs tariffs. Rules and rates of regional and local taxation must conform to the framework established by the Code. Taxes or levies not listed explicitly by the Code or enacted in violation of its specific provisions are deemed illegal and void.' => 'Kodex ist ausgearbeitet als beleibtes nationales Gebäude der, reginärer und einheimischer Bündesteuern, aber ausnimmt Zölletarife. Regel und Normen das reginäre und einheimischer der Besteuerung müssen zutreffen Umrahmungen, die authentischer Kodex ansetzen.
    Steuern oder Versammlungen, nicht durchgezählter in ersichtlichem Äußere des Kodexs oder angenommener in Verletzung ihriger konkreter Lagen achten ungesetzlicher und ungültiger.',
    'Many direct and indirect taxes exist in Germany; income tax and VAT are the most significant. The German word for tax is die Steuer which originates from the Old High German word stiura meaning help. The Financial Secrecy Index ranks Germany as the 8th safest tax haven in the world, ahead of Jersey but behind Lebanon.' => 'Besteht große Anzahl der aufrechten und indirekter Steuern in Deutschland; Lohnsteuer und NDS spuken höchst signifikanter. Deutsches Wort für Steuer zu hinübergehen Stieur das ist aus Altem Hochem deutschem Wort stiura Bedeutung der Aushilfe. Index der finanziellen Diskretion einnimmt Deutschland 8 ungefährlicher Schlupfwinkel in Steuer Friede, Ahead Jersey, aber hinter Libanon.',
    'According to the NKY 167.5.1 NDS was delivered as 20%. Plus, according to the military tax 1.5% of each sale is going as objective tax. Thus, 21.5% is the main tax The amount of tax calculated from the amount of interest accrued on the account and debited on a monthly basis.' => 'Nach NKY 167.5.1 NDS war bestimmt Steuer in 20 auch das, entsprechend militarischer Steuer 1,5% jedes Verkaufs geht als objektiver Steuer. Also, 21.5 ist hauptsächlicher Steuer Betrag der Steuer abrechnet ab Betrag der Zinse, die auf Abzählung und Abhauungen an allmonatlichen Anfangsgründe angerechnet ist.',
