    'You may use our services and products via a mobile device either through mobile applications or mobile optimized websites. This Privacy Policy also applies to such use of our services and products.' => 'Ihr können ausnutzen unsere Gefallen und Produkte durch mobile Einrichtung oder durch mobile Anbiegungen und mobiler optimierter Websites. Diese Politik konfidentieller gleichfalls anpaßt sich zu derart Ausnutzung unserer Produkte und Gefallen.',
    'Your privacy is important to us and we have taken steps to ensure that we do not collect more information from you than is necessary for us to provide you with our services and to protect your account.' => 'Euer konfidentieller ist sehr beachtenswert für uns, und wir annahmen Anstalten, auf daß zu garantieren, daß wir nicht ablesen mehr Information ab euch, was dieser ist erforderlich für uns, auf daß zu anheimstellen euch unsere Gefallen und für Schutz eueres Rechnungswesen Aufschreibens.',
        'Information including, but not limited to, user name, address, phone number, fax number, email address, gender, date and/or year of birth and user preferences ("Registration Information") may be collected at the time of user registration on the Sites.' => 'Information, mitsamt, aber nicht beschränkt sich, Name des Benutzers, Adresse, Nummer des Fernsprechers, Nummer faxen, Adresse der elektronischen Post, Fußböden, Datum und / oder Jahrgänge und benutzerdefinierte Bevorzugungen (Registrierunginformation") können sein gesammelt auf Moment der Registrierung des Benutzers an Websites.',
