    'above' => 'höher',

    'All Voluntary Information may be made publicly available on the Sites and therefore accessible by any internet user. Any Voluntary Information that you disclose to us becomes public information and you relinquish any proprietary rights (including but not limited to the rights of confidentiality and copyright) in such information. You should exercise caution when deciding to include personal or proprietary information in the Voluntary Information that you submit to us.' => 'All freiwilliger Information kann sein öffentlich zugänglicher an websites und, also, zugänglicher für beliebiger Internets-benutzer.
    Beliebiger freiwilliger Information, die Sie uns hinstellt Eigentum der Öffentlichkeit Information anheimstellen, und ihr zu ausschlagen ab irgendeinen Eigentumsrechten (darunter, aber nicht beschränkt sich Anrechte konfidentieller und Autorenrecht) in derart Information. Ihr müssen bekunden vorsichtiger bei Beschlußfassung einschließen in sich persönliche oder konfidentieller Information in freiwilliger Information, die Sie uns anheimstellen.',
    'We may provide statistical information to third parties, but when we do so, we do not provide personally-identifying information without your permission.' => 'Wir können anheimstellen statistische Information Drittengesichtern, aber wann wir machen dieser, wir nicht anheimstellen personale Information über ohne euere Erlaubnis.',
    'We may share your Account Information with banks or vendors to enable your transactions on the Sites to be completed. In addition, we may use your Account Information to determine your credit-worthiness and, in the process of such determination, we may need to make such Account Information available to banks or credit agencies. While we have in place up-to-date technology and internal procedures to keep your Account Information and other Personal Data secure from intruders, there is no guarantee that such technology or procedures can eliminate all of the risks of theft, loss or misuse.' => 'Wir können teilen sich Information über Rechnungswesen Aufschreiben mit Gläsern oder Lieferanten dazu, auf daß euere Abmachungen an websites muß sein abgeschlossen.
    Außerdem, wir können ausnutzen euere Benutzer Information, auf daß zu bestimmen euer Kreditfähigkeit und, in Proceß der derart Bestimmung, wir, möglich, abfordert, auf daß zu erledigen derart Information Account zugänglicher Gläsern oder Krediteagenturen.',
    'Während wir an Ort der up-to-Edge Technologien und inländischer Verfahren, auf daß zu behalten Information über Euerer Abzählung und andere persönliche Angaben in Sicherheit ab Übeltätern, ist keine Bürgschaft, daß derart Technologie oder Verfahren können abschaffen all Risiken des Diebstahls, Einbuße oder unregelmäßige Ausnutzung.',
    'We employ commercially reasonable security methods to prevent unauthorized access to the Sites, to maintain data accuracy and to ensure the correct use of the information we hold.' => 'Wir ausnutzen all kaufmännisch Geist Methoden der Sicherheit für Verhinderung des unberechtigten Eingangs zu websites, für Unterhaltung der Genauigkeit der Angaben und Versorgung der korrekten Ausnutzung der Information wir durchführen.',
    'For registered users of the Sites, your Registration Information and Account Information (if any) can be viewed and edited through your account, which is protected by a password. We recommend that you do not divulge your password to anyone. Our personnel will never ask you for your password in an unsolicited phone call or in an unsolicited email. If you share a computer with others, you should not choose to save your log-in information (e.g., user ID and password) on that shared computer. Remember to sign out of your account and close your browser window when you have finished your session.' => 'Für registrierte Benutzer auf websites, Registrierunginformation und Information der Abzählung (falls jeder haben) können sein sucht und bearbeitet anhand Account, das Kennwort geschützt ist.
    Wir anbefehlen euch nicht preisgeben ihriges Kennwort niemand. Unser Personal keinmal nicht ist zu abfragen euer Kennwort in unerwünschte telephonische Glocken oder unerwünschte elektronische Post. Falls ihr abteilen Computer mit anderer, ihr nicht müssen wählen, auf daß zu behalten Registrierunginformation (z.B., ID des Benutzers und Kennwort) an diesem erschwinglichem Computer. Nicht vergiß zu aussteigen aus euerer Abzählung und zu zumachen Fenster Browser, wann ihr beendeten Session.',
    'No data transmission over the internet or any wireless network can be guaranteed to be perfectly secure. As a result, while we try to protect the information we hold for you, we cannot guarantee the security of any information you transmit to us and you do so at your own risk.' => 'Keine Abgabe der Angaben via Internet oder beliebiges drahtloses Netz kann sein garantiert ist absolut ungefährlicher. In Ergebnis, während wir befleißen, Information, die wir für euch aufbewahren zu schützen, wir nicht können garantieren Sicherheit der beliebigen Information, die ihr uns bestellen, und ihr machen dieser auf ihrige Angst und Risiko.',
    'We use "cookies" to store specific information about you and track your visits to the Sites. It is not uncommon for websites to use cookies to enhance identification of their users.' => 'Wir ausnutzen "Cookie" für Aufhebung der bestimmten Information über euch, und Spur Besuch der Sehenswürdigkeiten. Dieser ist nicht selten für Webseiten, auf daß zu ausnutzen cookie für Aufsteigen Identifikation ihriger Benutzer.',
    'A "cookie" is a small amount of data that is sent to your browser and stored on your computer\'s hard drive. A cookie can be sent to your computer\'s hard drive only if you access the Sites using a computer. If you do not de-activate or erase the cookie, each time you use the same computer to access the Sites, our web servers will be notified of your visit to the Sites and in turn we may have knowledge of your visit and the pattern of your usage.' => '"Cookie" darstellt sich kleiner Umfang der Angaben, der auf euer Browser und erhält sich an hartem Diskus eueres Computers sendet. Backwerk kann sein abgefertigt auf harten Diskus eueres Computers, allein falls ihr Eingang zu websites anhand Computers.
    Falls ihr nicht deaktivieren oder zu entfernen cookie, jedesmal wenn ihr ausnutzen eins und selber Computer für Eingang zu websites, unsere Web-Server sind benachrichtigt über Besuch zu websites und wir in ihriger Wende kann haben Wissen eueres Besuchs und Vorbild euerer Ausnutzung.',
    'Generally, we use cookies to identify you and enable us to' => 'Als Regel, wir ausnutzen cookie, auf daß zu identifizieren euch und erlaubt uns',
    'Access your Registration Information or Account Information so you do not have to re-enter it;' => 'Eingang zu Registrierung der Angaben oder Angaben der Abzählung, dermaßen daß ihr nicht müssen abermals einführen ihn;',
    'Gather statistical information about usage by users;' => 'Ablies statistische Angaben über Ausnutzung Benutzer;',
    'Research visiting patterns and help target advertisements based on user interests;' => 'Durchforschungen des Besuchs Muster und Aushilfe Annoncenankündigungen, die an Interessen der Benutzer gegründet ist;',
    'Assist our partners to track user visits to the Sites and process orders;' => 'Unseren Partnern zu \'aufhelfen, auf daß Spur Benutzer der Besuche websites und technologische Aufträge;',
    'Track progress and participation in promotions.' => 'Spur der Aufwärtsentwicklung und Beteiligung sich an Aktionen.',
    'You can determine if and how a cookie will be accepted by configuring the browser which is installed in the computer you are using to access the Sites. If you choose, you can change those configurations. By setting your preferences in the browser, you can accept all cookies or you can choose to be notified when a cookie is sent or you can choose to reject all cookies. If you reject all cookies by choosing the cookie-disabling function in your browser, you may be required to re-enter information on the Sites more often and certain features of the Sites may be unavailable.' => 'Ihr können bestimmen, wenn auch als derjenige cookie sind angenommen Abstimmungen Browser, das in Computer, der ihr für Eingang zu websites ausnutzen angesetzt ist. Falls ihr wählen, ihr können verraten Abstimmungen.
    Ansetzt ihrige Bevorzugungen in Browser, ihr können annehmen all Dateien oder ihr können wählen, auf daß zu übernehmen Benachrichtigung, wann Backwerk zusteuert oder ihr können wählen, auf daß zu ausschlagen all cookie. Falls ihr aberkennen all cookies, wählt Funktion cookies Abschaltung in euer Browser, euch es kann abfordern abermals zu einführen Information an websites häufig und einige Seltsamkeiten website können sein unzugänglich.',
